import React from "react";
import ReactDOM from 'react-dom';
import "bootstrap/dist/css/bootstrap.min.css";
import { Switch, Route, Link } from "react-router-dom";
import "./App.css";
// import Item from "./components/Item";
// import ItemList from "./components/ItemList";

function Car(props) {
  return <li>I am a { props.brand }</li>;
}

function Garage() {
  const cars = [
    {id: 1, brand: 'Ford'},
    {id: 2, brand: 'BMW'},
    {id: 3, brand: 'Audi'}
  ];
  return (
      <>
        <h1>Who lives in my garage?</h1>
        <ul>
          {cars.map((car) => <Car key={car.id} brand={car.brand} />)}
        </ul>
      </>
  );
}

function App() {

  // const display  = () => {
  //   ReactDOM.render(<Garage />, document.getElementById('root'));
  // }
  //
  // return (
  //     <body>
  //       <button id="root" onClick={display}>Press here !</button>
  //     </body>
  // );

  return (
      <Router>
        <div>
          <Link to="/">Home</Link>
        </div>
        <div>
          <Link to="/blogs">Get items by brand</Link>
        </div>
        <div>
          <Link to="/contact">Contact Me</Link>
        </div>

        <hr />

        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/blogs">
            <Blogs />
          </Route>
          <Route path="/contact">
            <Contact />
          </Route>
        </Switch>
      </Router>
  );
}

export default App;
